import React from 'react'
import {View,TextInput, StyleSheet , Button,} from 'react-native'
function AddNew() {
    return (
        <View style={style.view}>
            <TextInput style={style.text} placeholder="e.g. SQL , JavaScript" />
            <TextInput style={style.definition} multiline placeholder="New Definition Goes here ..."/>
            <Button title="Add" />
        </View>
    )
}

const style = StyleSheet.create({
    view:{

        alignItems: 'center',
        marginTop:30
    }
    ,
    text: {
        width:'80%',
        height:100,
        borderRadius:40,
        borderWidth:3,
        borderColor:'#999',
        textAlign: 'center',
        fontSize:20
    },
    definition:{
        width:'80%',
        marginTop:20,
        height:500,
        borderRadius:40,
        borderWidth:3,
        borderColor:'#999',
        textAlign:'left',
        padding:10,
        fontSize:20
    }
})

export default AddNew;
